package main

/* a cube */

import (
    "math/rand"
    "image"
    "image/color"
    "image/png"
	"math"
	"github.com/hortencio-main/go-sr"
    "os"
)

type Vec3 struct {
    x, y, z float32
}

const (
    PI     = 3.14159                            //
    fov    = 45.0                               // field of view in degrees
    height = 500                                // framebuffer height in characters
    width  = 500                                // framebuffer width in characters
    aspect = float32(width)/float32(height)     // aspect ratio (adjusted to 5:8, for a square output on the terminal)
    near   = 0.1                                // near plane
    far    = 100.0                              // far plane
)

func init() {
    sr.Viewport(width, height)                 // create an framebuffer for the render
    sr.PolygonMode(sr.FRONT_AND_BACK, sr.FILL) // set line drawing mode
}

func main() {
	var (
        top    float32 = near * float32(math.Tan(fov * PI / 360.0))
        bottom float32 =        -top
        right  float32 =  top*aspect
        left   float32 =      -right
        proj = sr.Frustum(left, right, bottom, top, near, far) // Set up perspective projection
    )

    //~ camPos := Vec3{6,8,10}
    camPos := Vec3{6,5,6}

    view := sr.LookAt( camPos.x, camPos.y, camPos.z, 0, 0, 0)
    sr.SetCamera(proj, view)
    sr.ClearColor(
        0,
        170.0/255.0,
        170.0/255.0,
    )
    
    sr.Begin()
    sr.Rotatef( []float32{110, 1.0, 0, 5.0} )
        for v := 0; v < len(cube); v+=4 {
            //~ sr.Color3f( 1.0, 0.0, 0.0)
            sr.Color3f( rand.Float32(), rand.Float32(), rand.Float32())
            sr.Vertex3f(cube[v  ][0],cube[v  ][1],cube[v  ][2])
            sr.Vertex3f(cube[v+1][0],cube[v+1][1],cube[v+1][2])
            sr.Vertex3f(cube[v+2][0],cube[v+2][1],cube[v+2][2])
            sr.Vertex3f(cube[v+3][0],cube[v+3][1],cube[v+3][2])
        }
        
        
    sr.End()
    
    // Read framebuffer from sr
    fb := sr.ReadPixels()

    // Create RGBA image
    img := image.NewRGBA(image.Rect(0, 0, width, height))

    for y := 0; y < height; y++ {
        for x := 0; x < width; x++ {
            px := fb[x+width*y]
            // px is []float32{r,g,b}, values between 0â€“1
            r := uint8(px[0] * 255)
            g := uint8(px[1] * 255)
            b := uint8(px[2] * 255)
            img.Set(x, y, color.RGBA{r, g, b, 255})
        }
    }

    // Save to PNG
    out, err := os.Create("output.png")
    if err != nil {
        panic(err)
    }
    defer out.Close()
    png.Encode(out, img)
}

